INSERT INTO public.solicitudes_autorizacion (id, cofirmada, denegada, descripcion, especialidad_profesional_medico, fecha_cofirma, fecha_creacion, fecha_firma, firmada, motivo, nif_centro_medico, nif_nie_paciente, nif_nie_profesional_medico, nombre_centro_medico, nombre_paciente, nombre_profesional_medico, paciente_id, profesional_medico_id) VALUES (1, true, false, 'Se solicita acceso al historial de evaluaciones previas, resultados de test psicométricos y reportes de intervenciones terapéuticas para identificar patrones conductuales y emocionales, con el fin de establecer un diagnóstico diferencial y diseñar un plan terapéutico personalizado.', '1', '2025-04-14 23:56:28.841905', '2025-04-13 01:12:42.575547', '2025-04-13 01:12:48.575547', true, 'Evaluación psicológica integral para diagnóstico de trastornos emocionales y conductuales', '17205375H', '60704841K', '05988721G', 'centro-medico-default', 'paciente-default', 'Cristian Andrés Córdoba Silvestre', 1, 1);
INSERT INTO public.solicitudes_autorizacion (id, cofirmada, denegada, descripcion, especialidad_profesional_medico, fecha_cofirma, fecha_creacion, fecha_firma, firmada, motivo, nif_centro_medico, nif_nie_paciente, nif_nie_profesional_medico, nombre_centro_medico, nombre_paciente, nombre_profesional_medico, paciente_id, profesional_medico_id) VALUES (2, false, true, 'Acceso solicitado para examinar antecedentes psiquiátricos, tratamientos previos y registros de episodios depresivos o ansiosos, con el objetivo de ajustar la intervención terapéutica actual y optimizar el manejo del paciente.', '5', null, '2025-04-13 01:16:26.832760', '2025-04-13 01:24:26.832760', true, 'Revisión integral del historial en salud mental', '23938402W', '60704841K', '12345678Z', 'Centro Medico Adeslas', 'paciente-default', 'Monica Garcia Ripoll', 1, 5);
INSERT INTO public.solicitudes_autorizacion (id, cofirmada, denegada, descripcion, especialidad_profesional_medico, fecha_cofirma, fecha_creacion, fecha_firma, firmada, motivo, nif_centro_medico, nif_nie_paciente, nif_nie_profesional_medico, nombre_centro_medico, nombre_paciente, nombre_profesional_medico, paciente_id, profesional_medico_id) VALUES (3, false, false, 'Se solicita acceso al historial clínico para revisar antecedentes de lesiones, tratamientos tópicos y reacciones cutáneas, con el propósito de confirmar el diagnóstico y planificar el tratamiento adecuado.', '2', null, '2025-04-13 01:19:32.713517', '2025-04-13 01:19:37.713517', true, 'Evaluación integral de afecciones cutáneas', '17205375H', '60704841K', '12345678Z', 'centro-medico-default', 'paciente-default', 'Juan Perez', 1, 2);
INSERT INTO public.solicitudes_autorizacion (id, cofirmada, denegada, descripcion, especialidad_profesional_medico, fecha_cofirma, fecha_creacion, fecha_firma, firmada, motivo, nif_centro_medico, nif_nie_paciente, nif_nie_profesional_medico, nombre_centro_medico, nombre_paciente, nombre_profesional_medico, paciente_id, profesional_medico_id) VALUES (4, true, false, 'Se solicita acceso al historial clínico para revisar antecedentes de lesiones pigmentadas, cambios en la coloración y tratamientos previos, con el objetivo de determinar la necesidad de estudios complementarios y ajustar la estrategia terapéutica de forma oportuna.', '2', '2025-04-16 20:41:05.998804', '2025-04-13 01:20:53.111870', '2025-04-13 01:20:57.111870', true, 'Seguimiento y evaluación de lesiones pigmentadas', '23938402W', '60704841K', 'X0655490J', 'Centro Medico Adeslas', 'paciente-default', 'Manuel Gimenez Rivilla', 1, 6);
INSERT INTO public.solicitudes_autorizacion (id, cofirmada, denegada, descripcion, especialidad_profesional_medico, fecha_cofirma, fecha_creacion, fecha_firma, firmada, motivo, nif_centro_medico, nif_nie_paciente, nif_nie_profesional_medico, nombre_centro_medico, nombre_paciente, nombre_profesional_medico, paciente_id, profesional_medico_id) VALUES (5, true, false, 'Acceso requerido para revisar intervenciones previas, programas de rehabilitación y evolución de la función motora, a fin de diseñar un plan terapéutico personalizado y optimizado.', '3', '2025-04-14 23:58:39.367727', '2025-04-13 01:23:18.558104', '2025-04-13 01:23:21.558104', true, 'Consulta de rehabilitación y seguimiento post-traumático', '17205375H', '87952828T', '87654321X', 'centro-medico-default', 'second-paciente-default', 'Maria Lopez', 2, 3);
INSERT INTO public.solicitudes_autorizacion (id, cofirmada, denegada, descripcion, especialidad_profesional_medico, fecha_cofirma, fecha_creacion, fecha_firma, firmada, motivo, nif_centro_medico, nif_nie_paciente, nif_nie_profesional_medico, nombre_centro_medico, nombre_paciente, nombre_profesional_medico, paciente_id, profesional_medico_id) VALUES (6, false, true, 'Solicitud de acceso a la información clínica para analizar síntomas articular, resultados de pruebas de inflamación y antecedentes de enfermedades autoinmunes, a fin de establecer un diagnóstico diferencial preciso y definir el tratamiento más adecuado.', '7', null, '2025-04-13 01:24:33.942252', '2025-04-13 01:24:35.942252', true, 'Revisión de antecedentes reumáticos y evaluaciones complementarias', '23938402W', '87952828T', '45908922W', 'Centro Medico Adeslas', 'second-paciente-default', 'Pablo Rodriguez Carrion', 2, 8);
INSERT INTO public.solicitudes_autorizacion (id, cofirmada, denegada, descripcion, especialidad_profesional_medico, fecha_cofirma, fecha_creacion, fecha_firma, firmada, motivo, nif_centro_medico, nif_nie_paciente, nif_nie_profesional_medico, nombre_centro_medico, nombre_paciente, nombre_profesional_medico, paciente_id, profesional_medico_id) VALUES (7, false, false, 'Se requiere acceso al historial médico global del paciente, abarcando desde antecedentes personales y familiares hasta pruebas diagnósticas previas, para obtener una visión completa que permita ajustar el diagnóstico y el plan terapéutico.', '6', null, '2025-04-13 01:26:01.452516', '2025-04-13 01:26:04.452516', true, 'Evaluación de historia clínica para atención integral', '23938402W', '87952828T', '48733805W', 'Centro Medico Adeslas', 'second-paciente-default', 'Laura Hernandez Diaz', 2, 7);
INSERT INTO public.solicitudes_autorizacion (id, cofirmada, denegada, descripcion, especialidad_profesional_medico, fecha_cofirma, fecha_creacion, fecha_firma, firmada, motivo, nif_centro_medico, nif_nie_paciente, nif_nie_profesional_medico, nombre_centro_medico, nombre_paciente, nombre_profesional_medico, paciente_id, profesional_medico_id) VALUES (8, true, false, 'Se solicita acceso al historial clínico para evaluar intervenciones quirúrgicas previas, episodios de infecciones urinarias y otros problemas urológicos, con miras a definir un manejo clínico y quirúrgico adecuado.', '4', '2025-04-16 20:44:25.795883', '2025-04-13 01:28:50.666923', '2025-04-13 01:28:50.666923', true, 'Análisis de antecedentes urológicos y procedimentales', '17205375H', '87952828T', '11223344Y', 'centro-medico-default', 'second-paciente-default', 'Carlos Garcia', 2, 4);
